=Analyze this lead submission and provide a JSON response with the following structure:

{
  "qualification_score": [0-100 integer],
  "buying_intent": "high" | "medium" | "low",
  "urgency_level": "immediate" | "this_week" | "this_month" | "exploratory",
  "budget_indicator": "enterprise" | "mid-market" | "small_business" | "unknown",
  "pain_points": ["list of identified pain points"],
  "recommended_action": "immediate_call" | "schedule_demo" | "nurture_sequence" | "disqualify",
  "summary": "2-3 sentence summary for sales team"
}

Lead Information:
Name: {{ $json.body.name }}
Email: {{ $json.body.email }}
Company: {{ $json.body.company }}
Message: {{ $json.body.message }}
Phone: {{ $json.body.phone || 'Not provided' }}
Website: {{ $json.body.website || 'Not provided' }}

**IMPORTANT INSTRUCTIONS:**
1. If website or email domain is available, USE the clearbit_enrichment tool to get company data
2. Company size and revenue data are CRITICAL for accurate scoring
3. Extract the domain from website URL or email address
4. Call tool format: {"domain": "company.com"}
5. Use enrichment data in your qualification scoring

