const c = $input.first().json;

return {
  json: {
    success: true,
    company_name: c.name,
    domain: c.domain,
    employees: c.metrics?.employees || 0,
    employee_range: c.metrics?.employeesRange || 'Unknown',
    industry: c.category?.industry || 'Unknown',
    sector: c.category?.sector,
    description: c.description,
    location: [c.geo?.city, c.geo?.stateCode, c.geo?.country].filter(Boolean).join(', '),
    founded: c.foundedYear,
    annual_revenue: c.metrics?.annualRevenue,
    funding: c.metrics?.raised,
    tech: (c.tech || []).slice(0, 10).join(', '),
    summary: `${c.name} - ${c.category?.industry || 'company'}, ${c.metrics?.employeesRange || 'unknown size'}, ${c.geo?.city || 'location unknown'}`
  }
};

return {
  json: {
    success: false,
    domain: $('When called by another workflow').first().json.domain,
    error: 'Company not found',
    summary: 'No data available'
  }
};

