// Parse AI Agent output and structure data for downstream nodes
const aiResponse = JSON.parse($input.first().json.output);
const leadData = $('Form Submission5').first().json.body;

return {
  json: {
    // Original lead information
    name: leadData.name,
    email: leadData.email,
    company: leadData.company,
    phone: leadData.phone || '',
    website: leadData.website || '',
    message: leadData.message || '',

    // AI qualification results
    qualification_score: aiResponse.qualification_score,
    buying_intent: aiResponse.buying_intent,
    urgency_level: aiResponse.urgency_level,
    budget_indicator: aiResponse.budget_indicator,
    pain_points: aiResponse.pain_points,
    recommended_action: aiResponse.recommended_action,
    ai_summary: aiResponse.summary,

    // Metadata
    submission_date: new Date().toISOString(),
    source: 'website_form',
    workflow_version: '2025-pro',

    // Extract domain for potential enrichment
    domain: leadData.website 
      ? new URL(leadData.website).hostname.replace('www.', '')
      : leadData.email.split('@')[1]
  }
};

